import logo from './logo.svg';
import './App.css'; //Importa los estilos

const Mensaje = () => {
  const mensaje = "Buenas noches"
  return(
    <div>
        {mensaje + ", que descanses"}
        <br />
        {+ new Date()}
    </div>
  )
}

const Descripcion = () => {
  return(
    <div>
      <h1>Aplicacion en proceso mental</h1>
      <strong>En desarrollo</strong>
    </div>
  )
}

function App () {
  return (
    <div className="App">
      <Descripcion />
      <Mensaje />
    </div>
  )
}

export default App;
